import React from 'react';
import './App.css';
import Accordian from './accordian';
import {Container} from '@material-ui/core'

function App() {
  return (
    <div className="App">
    <Container>
    <Paper>
    <Box>
      <Accordian/>
      </Box>
      </Paper>
    </Container>
    </div>
  );
}

export default App;
